if mibBuilder.loadTexts: rtgTandemTraffic.setDescription('This attribute specifies whether tandem traffic is permitted through the node. Tandem traffic is traffic which arrives at the node on a trunk and leaves the node on a trunk. Traffic to or from a gateway (internal or external) is not affected by the setting of this attribute. The default value of this attribute is allowed, which permits tandem traffic to be routed through the node. When this attribute is set to denied, DPN, VNS, and PORS traffic are not permitted to tandem through the node. Changing this attribute has no effect on PORS calls which were set up before the change. These calls can be manually forced to reroute using the new setting by clearing the calls or locking the trunks on which they are routed.')
